import React from 'react';

export default function LoginForm() {
  return (
    <form action='/api/auth/login'>
      <div>
        <input type='email' />
      </div>
      <div>
        <input type='password' />
      </div>
      <div>
        <button type='submit'>Login</button>
      </div>
    </form>
  );
}
